INSERT INTO `review` (`id`, `url`, `date`, `username`, `caption`, `msg`, `answer`, `star`, `star_col`, `sid`, `ip`) VALUES
(1, 'prokat_Lexus_IS250', '2017-08-31 12:00:00', 'Василий Петросян', 'Норм', 'Я взял авто на прокат на день. Шикарный авто, быстро едет, мало есть, маневренный, шумка хорошая (ручка вроде не скрипит) Так что когда надо перехватить авто уже знаю куда обращаться', '', '5', '1', '', ''),
(2, 'prokat_Lexus_IS250', '2017-08-10 13:00:00', 'Марина', ':)', 'Думала взять на пару дней на тест-драйв перед покупкой, так как у дилера за 10 минут сложно понять что-то. В итоге проездила почти неделю, пока не получила свой новенький луксус из салона', '', '5', '1', '', ''),
(3, 'prokat_Lexus_IS250', '2017-08-22 13:00:00', 'Серега', 'Скрипит ручка двери', 'Поехал в Ростов в командировку на неделю, при том что пробег у авто уже не маленькия проблем с ним не было. Единственно скрипт немного ручка открывания передней пасажирской двери, а так авто супер', '<b>Сергей, добрый день.</b><br> Благодарим за отзыв. Мы исправили данный недочет.', '4', '1', '', ''),
(4, 'prokat_Lexus_IS250', '2017-09-04 22:04:35', 'Максим', 'Красная поляна', 'Брали машину на входные для поездки в Красную поляну. Проблем с авто не было, жене машина понравилась, все влезли и лыжи тоже', '', '05', '0', '1d0b2465b75d00fff330d109af3b321d', '128.70.190.6'),
(5, 'prokat_Infiniti_EX35', '2017-10-23 08:43:59', 'Света', 'Свадьба', 'Заказывали Infiniti на свадьбу остались очень довольны.', '', '5', '1', 'a4a030709fe55620c383eac08d4d67e6', '128.74.170.2');

